INSERT INTO `purposes` VALUES (1,'---\n- Quibusdam atque iste voluptatem et velit.\n- Occaecati tempora ea similique.\n'),(2,'---\n- Qui voluptas et praesentium culpa.\n- Enim qui qui.\n'),(3,'Ersatzstativ fr die Ausstellung.'),(4,'Ersatzstativ fr die Ausstellung.'),(5,'Ersatzstativ fr die Ausstellung.'),(6,'Ersatzstativ fr die Ausstellung.'),(7,'Ersatzstativ fr die Ausstellung.'),(8,'Ersatzstativ fr die Ausstellung.'),(9,'Ersatzstativ fr die Ausstellung.'),(10,'Ersatzstativ fr die Ausstellung.'),(11,'Ersatzstativ fr die Ausstellung.'),(12,'Ersatzstativ fr die Ausstellung.'),(13,'Ersatzstativ fr die Ausstellung.'),(14,'Ersatzstativ fr die Ausstellung.'),(15,'Ut perspiciatis necessitatibus iste sit qui illum placeat.'),(16,'Architecto aut sint earum quos possimus animi minima.'),(17,'Officia in non excepturi modi.'),(18,'Omnis molestiae qui aut sunt dolor.'),(19,'Cumque fugit eum voluptatem quod eum et qui.'),(20,'Laboriosam ut eligendi esse non.'),(21,'Et maxime et perferendis magnam corrupti officiis.'),(22,'Voluptas distinctio et similique reiciendis sequi est reprehenderit.'),(23,'Bentige ich fr die Aufnahmen meiner Abschlussarbeit.'),(24,'Sit repellendus aspernatur tenetur culpa vel at assumenda dolorem.'),(25,'Facere maxime atque consectetur quo dolores dolor.'),(26,'Tenetur corrupti aperiam cum officiis quis earum est assumenda.'),(27,'Ipsa alias totam dolorem et temporibus provident suscipit qui.'),(28,'Ersatzstativ fr die Ausstellung.'),(29,'Fr das zweite Austellungswochenende.'),(30,'Fr das dritte Austellungswochenende.'),(31,'Fr die Abschlussarbeit.'),(32,'Ersatzstativ fr die Ausstellung.'),(33,'Bestellung mit Software'),(34,'Bestellung mit Gegenstand ohne Ort'),(35,'Um meine Abschlussarbeit zu fotografieren.'),(36,'Sed inventore neque ipsam voluptatibus ea enim distinctio.'),(37,'Um meine Abschlussarbeit zu fotografieren.'),(38,'Um meine Abschlussarbeit zu fotografieren.'),(39,'Quo similique maxime consequatur maiores.'),(40,'Paketausgabe'),(41,'Fr meinen